Its.Complicated(2009)Dvdr.nl.sub NLT Release (Divx)

Jane (Meryl Streep) is moeder van drie volwassen kinderen, ze heeft een goedlopend restaurant in Santa Barbara, en heeft na tien jaar gescheiden te zijn een vriendschappelijke relatie met haar ex-man, advocaat Jake (Alec Baldwin). Maar wanneer Jane en Jake de stad uit zijn omdat hun zoon afstudeert, worden de zaken gecompliceerd. Een onschuldig etentje wordt iets onvoorstelbaars; een verhouding. Nu Jake hertrouwd is met de veel jongere Agness, is Jane ineens ?de andere vrouw?. Architect Adam , die is ingehuurd om Janes keuken te verbouwen, raakt betrokken bij hun hernieuwde romance. Adam komt zelf net bij van een echtscheiding en valt voor Jane. Maar hij beseft al gauw dat hij deel uitmaakt van een liefdesdriehoek. 

